const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText } = wp.blockEditor;

registerBlockType("gb/simplecenterbranded", {
  title: __("Simple Center Branded", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "cta",
  attributes: {
    contentUA: { type: "string", default: `Boost your productivity.` },
    contentt: { type: "string", default: `Start using Workflow today.` },
    contentUB: {
      type: "string",
      default: `Ac euismod vel sit maecenas id pellentesque eu sed consectetur. Malesuada adipiscing sagittis vel nulla nec.`,
    },
    contentUC: { type: "string", default: ` Sign up for free ` },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;

    return (
      <div className="bg-indigo-700">
        
        <div className="max-w-2xl mx-auto text-center py-16 px-4 sm:py-20 sm:px-6 lg:px-8">
          
          <h2 className="text-3xl font-extrabold text-white sm:text-4xl">
            
            <span className="block">
              <RichText
                value={attributes.contentUA}
                default={"Boost your productivity."}
                onChange={(newtext) => setAttributes({ contentUA: newtext })}
              />
            </span>
            <span className="block">
              <RichText
                value={attributes.contentt}
                default={"Start using Workflow today."}
                onChange={(newtext) => setAttributes({ contentt: newtext })}
              />
            </span>
          </h2>
          <p className="mt-4 text-lg leading-6 text-indigo-200">
            <RichText
              value={attributes.contentUB}
              default={
                "Ac euismod vel sit maecenas id pellentesque eu sed consectetur. Malesuada adipiscing sagittis vel nulla nec."
              }
              onChange={(newtext) => setAttributes({ contentUB: newtext })}
            />
          </p>
          <a
            href="#"
            className="mt-8 w-full inline-flex items-center justify-center px-5 py-3 border border-transparent text-base font-medium rounded-md text-indigo-600 bg-white hover:bg-indigo-50 sm:w-auto"
          >
            <RichText
              value={attributes.contentUC}
              default={" Sign up for free "}
              onChange={(newtext) => setAttributes({ contentUC: newtext })}
            />
          </a>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;

    return (
      <div class="bg-indigo-700">
        
        <div class="max-w-2xl mx-auto text-center py-16 px-4 sm:py-20 sm:px-6 lg:px-8">
          
          <h2 class="text-3xl font-extrabold text-white sm:text-4xl">
            
            <span class="block">{attributes.contentUA} </span>
            <span class="block">{attributes.contentt} </span>
          </h2>
          <p class="mt-4 text-lg leading-6 text-indigo-200">
           <RichText.Content value={attributes.contentUB}/>
          </p>
          <a
            href={
              attributes.contentUC.match('(.*?)href="(.*?)"(.*?)')
                ? attributes.contentUC.match('(.*?)href="(.*?)"(.*?)')[2]
                : attributes.contentUC
            }
            class="mt-8 w-full inline-flex items-center justify-center px-5 py-3 border border-transparent text-base font-medium rounded-md text-indigo-600 bg-white hover:bg-indigo-50 sm:w-auto"
          >
            {attributes.contentUC.match("(?<=<.+.>)(.*?)(?=<.*/.+.?>)")
              ? attributes.contentUC.match("(?<=<.+.>)(.*?)(?=<.*/.+.?>)")[0]
              : attributes.contentUC}
          </a>
        </div>
      </div>
    );
  },
});
